import { Col, Row } from "react-bootstrap";
import * as Icon from "react-bootstrap-icons";

const Chat = () => {
  return (
    <Col>
      <Row className="mt-3">
        <input type="search" placeholder="search" className="w-100 px-3 mr-3" />
      </Row>
    </Col>
  );
};
export default Chat;
